# Copy the entire VGG16 model " with parameters"
vgg1 = VGG16(input_shape=IMAGE_SIZE, weights='imagenet')
vgg1.summary()

"""## *******************Copy VGG 16 Excluding the Dens part*******************

![image.png](data:image/png;base64,)
"""

# Copy the VGG16 model with parameters excluding the Dens part (the last three fully connected layers)
vgg2 = VGG16(input_shape=IMAGE_SIZE, weights='imagenet', include_top=False)
vgg2.summary()

# Copy the VGG16 model excluding the outrput layers
Vgg3 = Model(inputs=vgg1.input, outputs=vgg1.layers[-2].output)
Vgg3.summary()

# Copy VGG16 model excluding the last 2 FC layers
Vgg4 = Model(inputs=vgg1.input, outputs=vgg1.layers[-3].output)
Vgg4.summary()

"""to modify any pretrained model, we use Functional API instead of sequential that we used in tutorial 1.

**lets use VGG 16 as a feature extraction method. This method is called an unsupervised Transfer Learning Method because extracted features from each sample do not depend on the label of this sample.In transfer learning feature extraction method, we must freeze all the extracted layers from the pre-trained model**
"""

# Freeze all copied layers to use the model as feature extraction method
for layer in vgg2.layers:
  layer.trainable = False

"""lets check the # trainable parameters of this model after freeziong the layers."""

vgg2.summary()

"""lets use functional API method to modify the model. The output layer in the Vgg2 model is maxpooling layer and the data has 3D shape (High * width * channels (filters)). to add Dens layer for the output, we need to flatten the 3D shape input."""

# Add one Dens layer to the copied VGG16 model to develope a binary classifier. then put this structure in a new model
x = Flatten()(vgg2.output)
prediction = Dense(1, activation='sigmoid')(x)
model = Model(inputs=vgg2.input, outputs=prediction)
model.summary()

"""Lets generate another model that has 2 Dens layeres in the output part."""

#let's generate another Model(model2) based on VGG16. in this model, we add two Dens layers to the copied VGG16 model to develope a binary classifier. The goal here is to develop more task realted features.
x2 = Flatten()(vgg2.output)
x2 = Dense(1000, activation='relu')(x2)
prediction = Dense(1, activation='sigmoid')(x2)
model2 = Model(inputs=vgg2.input, outputs=prediction)
model2.summary()

